import styled from "styled-components";

export default styled.caption`
  font-weight: bold;
  text-align: left;
  padding-left: 10px;
  padding-bottom: 10px;

  @media only screen and (min-width: 1600px) {
    font-size: 1.5rem;
  }
`;
